import React from 'react'
import Select from 'react-select'

function Survey() {
    // JavaScript --> Ex: Function, etc.

    return (
        // HTML
        <div className='Survey'>
            <div className='Survey-Container'>
                <h1>Survey</h1>
                <div className='Survey-Content'>
                    <label>Business Name: </label>
                    <input type={"text"} id='BusinessNameInput' placeholder='Input Business Name' required/>
                    <br />

                    <label>Type of Business: </label>
                    <Select type={"text"} id='TypeOfBusinessInput' placeholder='Please Select the Type of Your Business' required/>

                </div>
            </div>
        </div>
    )
}

export default Survey;
